const ele = document.elementFromPoint(
      Math.floor(point.x),
      Math.floor(point.y));
if (ele?.closest(".window")) {
    window.api.setIgnoreMouse(false);
} else {
    window.api.setIgnoreMouse(true, { forward: true });
}

